  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0100115 includes chemical,
  discrete bottle, physical and time series profile data collected from Kairei, MIRAI
  and NATSUSHIMA in the North Pacific Ocean and South Pacific Ocean from 1999-05-28
  to 2008-10-26 and retrieved during cruise Time Series K2. These data include ALKALINITY
  - TOTAL, AMMONIUM, DISSOLVED INORGANIC CARBON, DISSOLVED OXYGEN, NITRATE, NITRITE,
  PHOSPHATE, SALINITY, SIGMA-THETA, SILICATE and TEMPERATURE. The instruments used
  to collect these data include bottle. These data were collected by Akihiko Murata
  of Japan Agency for Marine-Earth Science and Technology (JAMSTEC) and Shuichi Wantanabe,
  Makio Honda and Masahide Wakita of Japan Agency for Marine-Earth Science and Technology
  (JAMSTEC); Mutsu Institute for Oceanography; Ocean Observation and Research Department
  as part of the Time_Series_K2 data set.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
